  const reqBody = {
    "username" : "Lutendo",
    "password" : "Lodav72#"
  }

  fetch('api/auth/login', {
    headers : {
      "Content-Type" : "application/json" 
    },
    method : "post",
    body : JSON.stringify(reqBody),
  })
  .then((response) => Promise.all( [response.json(), response.headers]))
  .then(([body, headers]) => 
    Headers.array.array.forEach(element => {
      console.log(element);
    })
  );

  return <div className="App">
    <h1>Hello world</h1>
  </div>
}

export default App;
